import Todo from './Todo'


function List( { todos , setTodos} ) {

// console.log(todos)
    return (
<div className='list-container'>
<ul className='todo-list'>
{todos.map((todo) => (
    <Todo key={todo.id} text={todo.text} todos={todos} setTodos={setTodos} todo={todo}/>
))}
</ul>
</div>
    )
}

export default List
